/*

Oracle makes it *really* hard to load a JAR file into the database unless you have a full client.
Since I want to be able to load this from a lightweight client, I have to resort to this method.

This file essentially does what the loadjava tool does.

  - Load the JAR (in the form of a hex-string) into a BLOB
  - Split the JAR into individual class files
  - Load the class files into the "CREATE$JAVA$LOB$TABLE"
  - Call CREATE JAVA... for each of the class files
  - Compile the class files

*/

declare
  tablenotexists exception;
  pragma exception_init(tablenotexists, -942);
begin
  execute immediate 'drop table "CREATE$JAVA$LOB$TABLE" cascade constraints purge';
exception
  when tablenotexists then null;
end;
/

create table "CREATE$JAVA$LOB$TABLE" (
  name    varchar2(1000 char) primary key,
  lob     blob
)
/

prompt loading commons-codec-1.6.jar ...
declare

  b BLOB;
  z zip_table;

  procedure addto
    ( txt  in  varchar2 )
  is
    r  raw(512);
  begin
    r := hextoraw(txt);
    dbms_lob.writeAppend(b, utl_raw.length(r), r);
  end addto;

begin

  dbms_lob.createTemporary(b, true, dbms_lob.session);

